sympy.sympy.polys.domains.domain.convert:
def convert_from(self, element: Es, base: Domain[Es]) -> Er:
    """Convert ``element`` to ``self.dtype`` given the base domain. """
    if base.alias is not None:
        method = "from_" + base.alias
    else:
        method = "from_" + base.__class__.__name__

    _convert = getattr(self, method)

    if _convert is not None:
        result = _convert(element, base)

        if result is not None:
            return result

    raise CoercionFailed("Cannot convert %s of type %s from %s to %s" % (element, type(element), base, self))

sympy.sympy.polys.rings.set_ring:
def set_ring(self, new_ring: PolyRing[Es]) -> PolyElement[Es]:
    """Change the ring of this polynomial."""
    if self.ring == new_ring:
        return cast("PolyElement[Es]", self)
    return self._change_ring(new_ring)

sympy.sympy.polys.rings.is_ground:
@property
def is_ground(self) -> bool:
    # Return self.flint_poly.is_constant() in case of python-flint
    return not self or (len(self) == 1 and self.ring.zero_monom in self)
